webpackJsonp([0x963a930311a2],{3357:function(t,a){t.exports={data:{markdownRemark:{html:"<p><strong>🌡20℃ ☀</strong></p>\n<p>今日は少し気が早いかもしれませんが、冬休みに向けてスキーの準備をしていました。\n午後は家族で鶴ヶ島のホームセンター、ビバホームに行き、スキー用具を買って、帰りにちょっと本を書いました。\nエスティマの収納力が初めて役立った瞬間でした。</p>\n<p>夕飯は家族で外食に行きました。</p>",frontmatter:{cover:null,date:"1990-12-02T21:00:00+09:00",strDate:"1990/12/2",title:"日記"}}},pathContext:{path:"/ja/blog/1990/12/02-diary/",langKey:"ja"}}}});
